define('text!views/programdesigner/questiontypes/button.html',[],function () { return '<div class="row pad pad-top">\r\n    <!-- ko if: activeStep() -->\r\n    <h2 class="pad vertical" data-bind="text: header"></h2>\r\n    <!-- /ko -->\r\n    <p data-bind="text: header"></p>\r\n    <div class="span12">\r\n        <div class="row">\r\n            <button class="btn color" type="button" data-bind="text: text, click: completeAction, disable: !computedResponse() && !activeStep() || $parent.completed() === true || $parents[1].programsSaving() === true" />\r\n            <button class="pull-right" data-bind="click: $parent.saveAction, enable: !completed() && $parent.hasChanges() && !$parents[1].programsSaving()">Save</button>\r\n        </div>\r\n    </div>\r\n</div>';});


define('text!views/programdesigner/questiontypes/checkbox.html',[],function () { return '<div class="row pad pad-top">\r\n    <!-- ko with: header -->\r\n    <h2 class="pad vertical" data-bind="text: $data"></h2>\r\n    <!-- /ko -->\r\n    <h3 data-bind="html: question, css: { \'grey\': !computedResponse() && !activeStep() }"></h3>\r\n    <em class="gray" data-bind="html: notes"></em>\r\n    <!-- ko ifnot: $parent.completed() -->        \r\n    <!-- ko foreach: responses().sort($root.alphabeticalOrderSort) -->\r\n    <label class="control-group">\r\n        <div class="checker" data-bind="hoverToggle: \'hover\'">\r\n            <span data-bind="css: { \'checked\': value() === \'true\' }">\r\n                <input type="checkbox" data-bind="checked: value, disable: (!$parent.computedResponse() && !$parent.activeStep() || $parents[1].completed()), clickRadio: $parent.computedResponse" />\r\n            </span>\r\n        </div>\r\n        <strong data-bind="text: text, css: { \'grey\': !$parent.computedResponse() && !$parent.activeStep() }"></strong>\r\n    </label>\r\n    <!-- /ko -->\r\n    <!-- /ko -->\r\n    <!-- ko if: $parent.completed() -->\r\n    <br>\r\n    <!-- ko if: computedResponse() -->\r\n    <!-- ko foreach: responses().sort($root.alphabeticalOrderSort) -->\r\n    <!-- ko if: value() === \'true\' -->\r\n    <div class="row">\r\n        <i class="icon-check span1"></i><strong class="span11" data-bind="text: text"></strong><br>\r\n    </div>\r\n    <!-- /ko -->\r\n    <!-- /ko -->\r\n    <!-- /ko -->\r\n    <!-- ko if: !computedResponse() || hasNoTrueAnswers() === true -->\r\n    <strong><em class="push1">&ltNot Answered&gt</em></strong>\r\n    <!-- /ko -->\r\n    <!-- /ko -->\r\n</div>';});


