define('text!views/programdesigner/questiontypes/datetimepicker.html',[],function () { return '<div class="row pad pad-top">\r\n    <!-- ko with: header -->\r\n    <h2 class="pad vertical" data-bind="text: $data"></h2>\r\n    <!-- /ko -->\r\n    <h3 data-bind="html: question, css: { \'grey\': !computedResponse() && !activeStep() }"></h3>\r\n    <em class="gray" data-bind="html: notes"></em>\r\n    <!-- ko ifnot: $parent.completed() -->\r\n    <!-- ko with: computedResponse -->\r\n    <div class="span6">\r\n        <input data-bind="datepicker: value, datepickerOptions: {  }, disable: (!$parent.computedResponse() && !$parent.activeStep()|| $parents[1].completed())" type="text" class="datepicker">\r\n    </div>\r\n    <div class="span6">\r\n\t\t<!-- ko if: Modernizr.inputtypes.time -->\r\n\t\t\t<input data-bind="timepicker: value, valueUpdate: blur, disable: (!$parent.computedResponse() && !$parent.activeStep() || $parents[1].completed() || !value())" type="time">\r\n\t\t<!-- /ko -->\r\n\t\t<!-- ko ifnot: Modernizr.inputtypes.time -->\r\n\t\t\t<input id="value" data-bind="jqtimepicker: value, disable: (!$parent.computedResponse() && !$parent.activeStep() || $parents[1].completed() || !value())" type="text">\r\n\t\t<!-- /ko -->\r\n    </div>\r\n    <!-- /ko -->\r\n    <!-- /ko -->\r\n    <!-- ko if: $parent.completed() -->\r\n    <br>\r\n    <!-- ko if: computedResponse().value -->\r\n    <strong class="push1"><span data-bind="Date: computedResponse().value"></span> <span data-bind="LongTime: computedResponse().value"></span></strong>\r\n    <!-- /ko -->\r\n    <!-- ko ifnot: computedResponse().value -->\r\n    <strong><em class="push1">&ltNot Answered&gt</em></strong>\r\n    <!-- /ko -->\r\n    <!-- /ko -->\r\n</div>';});


