define('text!views/templates/allergies.panel.html',[],function () { return '<div class="panel-wrapper">\r\n    <div class="row">\r\n        <!-- ko foreach: columns -->\r\n        <div class="grey hover-parent" data-bind="css: cssClass">\r\n            <span data-bind="text: displayName"></span>\r\n            <!-- ko if: $parent.canSort && canSort -->\r\n                <i class="pull-right filter-toggle pad-right " data-bind="click: $parent.toggleSort, css: ($parent.selectedSortColumn() === sortProperty ? \'fa fa-caret-up\' : ($parent.selectedSortColumn() === sortProperty + \' desc\' ? \'fa fa-caret-down\' : \'\'))"></i>\r\n            <!-- /ko -->\r\n            <!-- ko if: ($parent.canSort  && canSort && ($parent.selectedSortColumn() !== sortProperty && $parent.selectedSortColumn() !== sortProperty + \' desc\'))  -->\r\n                <i class="pull-right hover-show fa fa-caret-up filter-toggle pad-right" data-bind="click: $parent.toggleSort"></i>\r\n            <!-- /ko -->\r\n        </div>\r\n        <!-- /ko  -->\r\n    </div>\r\n    <div data-bind="foreach: computedAllergies">\r\n        <div class="row divider" data-bind="foreach: $parent.columns">\r\n            <div data-bind="compose: { model: $parent, view: path }, css: cssClass"></div>\r\n        </div>\r\n        <div class="row pad allergydtl muted toggle" data-bind="visible: isExpanded">\r\n\t\t\t<div class="row pad-top">\r\n                <div class="span2">\r\n                    <strong>Type:</strong>\r\n                </div>\r\n                <div class="span10" data-bind="text: typeString"></div>                \r\n            </div>\r\n            <div class="row pad-top">\r\n                <div class="span2">\r\n                    <strong>Reaction:</strong>\r\n                </div>\r\n                <div class="span10" data-bind="text: reactionString"></div>                \r\n            </div>\r\n\t\t\t<div class="row pad-top">\r\n                <div class="span2">\r\n                    <strong>Source:</strong>\r\n                </div>\r\n                <div class="span10" data-bind="text: source().name()"></div>                \r\n            </div>\r\n\t\t\t<div class="row pad-top">\r\n\t\t\t\t<div class="span2">\r\n                    <strong>Start Date:</strong>\r\n                </div>\r\n                <div class="span3" data-bind="DateOrDash: startDate"></div>\r\n\t\t\t\t<div class="span2">\r\n                    <strong>End Date:</strong>\r\n                </div>\r\n                <div class="span3" data-bind="DateOrDash: endDate"></div>\r\n\t\t\t</div>\r\n            <div class="row pad-top">\r\n                <div class="span2">\r\n                    <strong>Notes</strong>\r\n                </div>\r\n                <div class="span10">\r\n                    <textarea disabled="disabled" data-bind="value: notes"></textarea>\r\n                </div>\r\n            </div>\r\n\t\t\t<div class="row pad-top">\r\n                <div class="span2">\r\n                    <strong>System:</strong>\r\n                </div>\r\n                <div class="span10" data-bind="text: systemName"></div>                \r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class="row" data-bind="visible: computedAllergies().length === 0">\r\n        <em>No data meets your filter criteria</em>\r\n    </div>\r\n</div>';});


define('text!views/templates/allergy.edit.html',[],function () { return '<div class="body" data-bind="with: allergy">\r\n    <div class="row">\r\n        <div class="span2 align-right grey">\r\n            Name:\r\n        </div>\r\n        <div class="span3 pad-left" data-bind="text: allergyName">\r\n        </div>\r\n        <div class="span2 align-right grey">\r\n            Status:\r\n        </div>\r\n        <div class="span3 pad-left">\r\n        \t<div data-bind="chsnsingle: { options: $parent.allergyStatuses, value: status, text: \'name\', label: \'action-status\', caption: \'Choose...\' }"></div>\r\n        </div>\r\n    </div>\r\n    <div class="row pad-top">\r\n        <div class="span2 align-right grey">\r\n            Reaction:\r\n        </div>\r\n        <div class="span3 pad-left">\r\n            <div class="span9" data-bind="multiselect: { options: $parent.reactions, values: reactionIds, idValue: \'id\', text: \'name\', label: \'reactions\', stringValue: reactionString }"></div>\r\n        </div>\r\n        <div class="span2 align-right grey">\r\n            Severity:\r\n        </div>\r\n        <div class="span3 pad-left">\r\n        \t<div data-bind="chsnsingle: { options: $parent.severities, value: severity, text: \'name\', label: \'action-status\', caption: \'Choose...\' }"></div>\r\n        </div>\r\n    </div>\r\n    <div class="row pad-top">\r\n        <div class="span2 align-right grey">\r\n            Source:\r\n        </div>\r\n        <div class="span3 pad-left">\r\n        \t<div data-bind="chsnsingle: { options: $parent.allergySources, value: source, text: \'name\', label: \'action-status\', caption: \'Choose...\' }"></div>\r\n        </div>\r\n    </div>\r\n    <div class="row pad-top">\r\n        <div class="span2 align-right grey">\r\n            Start Date:\r\n        </div>\r\n        <div class="span3 pad-left">\r\n\t\t\t<!-- ko compose: { model: \'viewmodels/templates/datetimepicker\', activationData:\r\n\t\t\t\t{\r\n\t\t\t\t\tobservableDateTime: startDate, dateErrors: startDateErrors, showInvalid: setInvalidStartDate, \r\n\t\t\t\t\tmaxDate: \'today\', datepickerOptions:{ maxDate: \'+0\' }, datepickerDynamicOptions: {}, dateName: \'startDate\'\r\n\t\t\t\t}\r\n\t\t\t} -->\r\n\t\t\t<!-- /ko -->\t\t\r\n        </div>\r\n        <div class="span2 align-right grey">\r\n            End Date:\r\n        </div>\r\n        <div class="span3 pad-left">\r\n\t\t\t\t<!-- ko compose: { model: \'viewmodels/templates/datetimepicker\', activationData:\r\n\t\t\t\t\t{\r\n\t\t\t\t\t\tobservableDateTime: endDate, dateErrors: endDateErrors, showInvalid: setInvalidEndDate, \r\n\t\t\t\t\t\tmaxDate: \'today\', datepickerOptions:{maxDate: \'+0\'}, datepickerDynamicOptions: {minDate: startDate}, dateName: \'endDate\'\r\n\t\t\t\t\t}\r\n\t\t\t\t} -->\r\n\t\t\t\t<!-- /ko -->\t\t\r\n        </div>\r\n    </div>\r\n    <div class="row pad-top"></div>\r\n    <div class="row">\r\n        <div class="span3 grey">\r\n            Notes:\r\n        </div>\r\n    </div>\r\n    <div class="row">\r\n        <div class="span12">\r\n            <textarea data-bind="value: notes"></textarea>\r\n        </div>\r\n    </div>\r\n    <div class="row pad-top">\r\n        <div class="span2 align-right grey">\r\n            Created On:\r\n        </div>\r\n        <div class="span2 pad-left grey" data-bind="DateOrDash: createdOn">\r\n        </div>\r\n        <div class="span2 align-right grey">\r\n            Updated On:\r\n        </div>\r\n        <div class="span2 pad-left grey" data-bind="DateOrDash: updatedOn">\r\n        </div>\r\n        <div class="span2 align-right grey">\r\n            System:\r\n        </div>\r\n        <div class="span2 pad-left grey" data-bind="text: systemName">\r\n        </div>\r\n    </div>\r\n</div>';});


